import Dashboard from "./containers/Dashboard";
import { ThemeProvider } from "styled-components";
import { GlobalStyles } from "./styles/Global";
import { lightTheme, darkTheme } from "./styles/"


function App() {
  return (
    <ThemeProvider theme={lightTheme}>
      <GlobalStyles />
    <Dashboard />
    </ThemeProvider>
  )
}

export default App;
